import './App.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import "bootstrap";
import Card_collection from "./Components/Card_collection";

import Logo from "./Logo.png";
import MyNav from "./Components/MyNav";
import Background from "./Components/Background";
import 'bootstrap/dist/css/bootstrap.min.css';
import React, {useState,useEffect} from "react";
import Categories from "./Components/Categories";
import Description from "./Components/Description";
import MyModal from "./Components/Modal";
import Footer from "./Components/Footer";
import arts from "./details/art.json";
import sports from "./details/sports.json";
import specialists from "./details/specialist.json";

function App() {


    const [sport,setSport] = useState([])

    for (const i in sports) {
        sport.push(sports[i])
    }
    const [art,setArt] = useState([])

    for (const i in arts) {
        art.push(arts[i])
    }
    const [specialist,setSpecialist] = useState([])

    for (const i in specialists) {
        specialist.push(specialists[i])
    }



  //   return (
  //   <div className="App">
  //       <MyNav/>
  //       <Background/>
  //
  //       <Categories/>
  //       <Description/>
  //
  //       <Card_collection cat={sport}/>
  //
  //       <Footer/>
  //   </div>
  // );
    const a_style = {
        "textDecoration":"none",
        color:'#6c757d'
    }
    return (
        <Router>
            <div>
                <MyNav/>
                <Background/>
                <div className={"relative flex text-xl w-full mt-8 justify-center md:text-4xl font-sans font-light"}>
                    <nav className={"w-full p-1"}>
                        <ol className={"breadcrumb justify-content-center"} >
                            <li className="breadcrumb-item"><Link to="/arts" style={a_style}>Arts</Link></li>
                            <li className="breadcrumb-item"><Link to="/sports" style={a_style}>Sports</Link></li>
                            <li className="breadcrumb-item "><Link to="/specialist" style={a_style}>Specialists</Link></li>
                        </ol>
                    </nav>
                </div>
                {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
                <Switch>
                    <Route path="/">
                        <Description/>
                        <Card_collection cat={art}/>
                        <Footer/>

                    </Route>
                    <Route path="/sports">
                        <Description/>
                        <Card_collection cat={sport}/>
                        <Footer/>
                    </Route>
                    <Route path="/specialist">
                        <Description/>
                        <Card_collection cat={specialist}/>
                        <Footer/>
                    </Route>
                </Switch>

            </div>
        </Router>
    );
}

export default App;
